  /**
   * 验证对象各属性之间的数据逻辑正确性。 
   * 创建日期：(2001-5-11)
   * 
   * @exception nc.vo.pub.ValidationException
   *              如果验证失败，抛出 ValidationException，对错误进行解释。
   */
  public void validate() throws ValidationException {

    ArrayList<String> errFields = new ArrayList<String>();
    // 检查是否为不允许空的字段赋了空值，你可能需要修改下面的提示信息：
    if (null == getCdeptid() || getCdeptid().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
          "common", "UC000-0004064")/* @res "部门" */);
    }
    if (null == getCreceipttype() || getCreceipttype().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
          "common", "UC000-0000807")/* @res "单据类型" */);
    }
    if (null == getCbiztype() || getCbiztype().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
          "common", "UC001-0000003")/* @res "业务类型" */);
    }
    if (null == getCreceiptcorpid() || getCreceiptcorpid().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
          "common", "UC000-0001899")/* @res "开票单位" */);
    }
    if (null == getCsalecorpid() || getCsalecorpid().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
          "common", "UC000-0004128")/* @res "销售组织" */);
    }
   if (null == getCcalbodyid() || getCcalbodyid().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID("common",
      "UC000-0001825")/* @res "库存组织" */);
   }
    if (null == getDbilldate()) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
          "common", "UC000-0000799")/* @res "单据日期" */);
    }
    if (null != getBfreecustflag() && getBfreecustflag().booleanValue()) {
      if (null == getCfreecustid() || getCfreecustid().length() == 0)
        errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
            "common", "UC000-0002272")/* @res "散户" */);
    }
    if (null == getCcurrencyid() || getCcurrencyid().length() == 0) {
      errFields.add(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID("common",
          "UC000-0001755")/* @res "币种" */);
    }
    // construct the exception message:
    StringBuffer message = new StringBuffer();
    message.append(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
        "40060501", "UPP40060501-000137")/* @res "下列字段不能为空：" */);
    if (errFields.size() > 0) {
      String[] temp = (String[]) errFields.toArray(new String[0]);
      message.append(temp[0].toString());
      for (int i = 1; i < temp.length; i++) {
        message.append(nc.vo.ml.NCLangRes4VoTransl.getNCLangRes().getStrByID(
            "SCMCOMMON", "UPPSCMCommon-000000"));
        message.append(temp[i].toString());
      }
      // throw the exception:
      throw new NullFieldException(message.toString());
    }
  }

