  /**
   * 方法功能描述：销售发票支持二次开发。
   * <b>参数说明</b>
   * @return
   * @time 2009-2-23 下午03:46:58
   */
  public static SOField[] getPluginFields() {
    // 支持二次开发VO扩展
    try {
      if (null != SaleVOMeta.extFieldMeta && SaleVOMeta.extFieldMeta.length > 0) {
        
        ArrayList<SOField> fields = new ArrayList<SOField>();

        for (SmartFieldMeta mt : SaleVOMeta.extFieldMeta) {
          
          SOField sofield = new SOField();
          sofield.setVoname(mt.getName());
          // 同voname dmo使用时判断
          sofield.setDatabasename(mt.getName());
          
          sofield.setTablename("so_saleinvoice");
          
          // 使用smart类型设置
          sofield.setUftype(mt.getType());
          sofield.setDatabasetype(mt.getDbType());

          fields.add(sofield);
        }

        pluginfields = fields.toArray(new SOField[0]);

      }

    } catch (Exception e) {
      SCMEnv.out("销售发票支持二次开发VO扩展读取主表扩展字段报错："+e.getMessage());
    }

    return pluginfields;

  }
